import React from 'react';
import './styles/index.scss';
import { BrowserRouter} from "react-router-dom";
import NavBar from './components/NavBar';
import Router from './components/router/Router';

function App() {
  return <BrowserRouter>
      <NavBar/>
      <Router/>
  </BrowserRouter>
}

export default App;
